  \"a-review-of-ecological-consequences-of-shifting-the-timing-of-burning-tallgrass-prairie\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This research brief is a review of \"Ecological
  Consequences of Shifting the Timing of Burning Tallgrass Prairie\", Towne and Craine
  2014.  This study shows that fall and winter burning in ungrazed watersheds of the
  Kansas Flint Hills can be conducted with little adverse effect on desirable forage
  species. The authors emphasize three key results from the experiment as evidence
  to support this case. First, end-of-season grass biomass in ungrazed prairie was
  not significantly different between autumn, winter or spring burns. Second, autumn
  and winter burns increased the window of opportunity for grasses to take advantage
  of spring precipitation for productivity compared to spring burns. Lastly, changes
  in plant composition from autumn and winter burns favor cool season grasses without
  negative impacts on warm season grasses, improving overall forage quality and potentially
  allowing for a longer grazing season.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
